import { FC } from 'react';
import { styled } from '@stitches/react';

const StyledSideber = styled('header', {
  background : 'rgba(6, 6, 6, 0.7)',
  color : '#FFFFFF',
  fontSize : '24px',
});

export const Sideber : FC = () => {
  return (
    <StyledSideber>
      <h3>All Note</h3>
      <h2> Programing</h2>
    </StyledSideber>
  );
}
